import React from 'react';

const Number = (props) => (
  <div className="range">
    <span> {props.name}: </span>
    <input
      className="form__input slider"
      type="range" min="1" value={props.imdb} max="10"
      onChange={props.handleChange}
      name="imdb"
    />
  </div>
);

export default Range;
